INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (1726,'CA','Monitor LCD 11/PM','Monitor passiu d\002711 polzades de Pantalla de cristall l\00edquid. La pantalla pr\00e0cticament plana d\0027alta resoluci\00f3 proporciona una qualitat d\0027imatge excepcional amb reducci\00f3 de l\0027enlluernament.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2359,'CA','Monitor LCD 9/PM','Monitor passiu de 9 polzades de Pantalla de cristall l\00edquid. Gaudiu de la productivitat que pot oferir treballar amb un monitor petit que us deixa m\00e9s espai a la taula. F\00e0cil instal\00b7laci\00f3 i compatibilitat plug-and-play.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3060,'CA','Monitor 17/HR','Monitor CRT de 17 polzades (16 d\0027imatge visible) d\0027alta resoluci\00f3. Rendiment d\0027imatge excepcional i les avantatges d\0027un espai de pantalla addicional. Aquest monitor ofereix una imatge n\00edtida amb amplitud de colors per un preu incre\00efble. Amb un ventall de funcions importants, com ara els controls de monitor en pantalla.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2243,'CA','Monitor 17/HR/F','Monitor de 17 polzades (16 d\0027imatge visible) d\0027alta resoluci\00f3 de pantalla plana. Emissor de fotons d\0027alta densitat amb Sistema de Correcci\00f3 El\00edptica Millorat que permet un focus m\00e9s consistent i prec\00eds a tota la pantalla, fins i tot a les cantonades.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3057,'CA','Monitor 17/SD','Monitor CRT de 17 polzades (16 d\0027imatge visible) de poca profunditat. Proporciona una claretat i precisi\00f3 d\0027imatge excepcionals. Ofereix als usuaris professionals del color, l\0027enginyeria t\00e8cnica i la visualitzaci\00f3/animaci\00f3 la fidelitat de color que exigeixen, a m\00e9s a m\00e9s d\0027un major espai a la taula per obtenir una productivitat millorada.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3061,'CA','Monitor 19/SD','Monitor CRT de 19 polzades (18 d\0027imatge visible) de poca profunditat. Capa de pantalla negra de gran contrast: produeix una qualitat superior de contrast i escala de grisos. Els altaveus professionals amplificats de nou disseny amb resposta de greus din\00e0mics vivifiquen totes les experi\00e8ncies d\0027\00e0udio i multim\00e8dia amb un so real i ric, amb tons greus profunds. A m\00e9s a m\00e9s, els cables codificats per colors, la senzilla instal\00b7laci\00f3 plug-and-play i els controls de pantalla digitals permeten gaudir de les excel\00b7lents possibilitats multim\00e8dia i la incre\00efble Internet en nom\00e9s uns minuts.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2245,'CA','Monitor 19/SD/M','Monitor de 19 polzades (18 d\0027imatge visible) de poca profunditat, monocrom. Rendiment d\0027imatge excepcional en un disseny compacte. Un men\00fa senzill en pantalla us ajudar\00e0 a ajustar les dimensions de la pantalla, els colors i els atributs d\0027imatge d\0027una manera senzilla. Nom\00e9s heu d\0027endollar el monitor al PC i ja podreu comen\00e7ar.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3065,'CA','Monitor 21/D','Monitor CRT de 21 polzades (20 d\0027imatge visible). Tecnologia OptiScan digital: admet resolucions de fins a 1600 x 1200 a 75 Hz. Dimensions (alt. x amp. x prof.): 21,1 x 47 x 28,1 cm. Els altaveus Platinum Series endollats al monitor, que es poden muntar i desmuntar, ofereixen un so n\00edtid i la comoditat d\0027un endoll de reproductor d\0027\00e0udio digital. Nom\00e9s heu d\0027endollar el reproductor d\0027\00e0udio digital i escoltar la m\00fasica sense necessitat d\0027engegar el PC.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3331,'CA','Monitor 21/HR','Monitor de 21 polzades (20 d\0027imatge visible) d\0027alta resoluci\00f3. Aquest monitor \00e9s ideal per a aplicacions gr\00e0fiques intensives, de publicaci\00f3 d\0027escriptori i d\0027empresa. Gaudiu de la productivitat que pot oferir un monitor gran que permet de disposar de m\00e9s espai de treball per executar aplicacions.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2252,'CA','Monitor 21/HR/M','Monitor de 21 polzades (20 d\0027imatge visible) d\0027alta resoluci\00f3, monocrom. Mides de la unitat: 35,6 x 29,6 x 33,3 cm. (14,6 kg) Embalatge: 40,53 x 31,24 x 35,39 cm. (16,5 kg). Freq\00fc\00e8ncia horitzontal 31,5 - 54 kHz. Freq\00fc\00e8ncia vertical 50 - 120 Hz. Font d\0027alimentaci\00f3 universal 90 - 132 V, 50 - 60 Hz.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3064,'CA','Monitor 21/SD','Monitor de 21 polzades (20 d\0027imatge visible) de poca profunditat. Entre les seves caracter\00edstiques s\0027inclou la tecnologia Aperture Grille Pitch 0,25-0,28, suport per a resolucions de fins a 1920 x 1200 a 76 Hz, visuallitzacions en pantalla i una pel\00b7l\00edcula antireflectant conductiva.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3155,'CA','Xarnera per a monitors - HD','Xarnera per a monitors, resistent; pes m\00e0xim del monitor: 30 kg');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3234,'CA','Xarnera per a monitors - STD','Xarnera per a monitors est\00e0ndar; pes m\00e0xim del monitor: 10 kg');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3350,'CA','Monitor de plasma 10/LE/VGA','Monitor de plasma de baix consum de 10 polzades, resoluci\00f3 VGA');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2236,'CA','Monitor de plasma 10/TFT/XGA','Monitor de pantalla plana TFT XGA de 10 polzades per a ordinadors port\00e0tils');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3054,'CA','Monitor de plasma 10/XGA','Monitor de plasma est\00e0ndard de 10 polzades, resoluci\00f3 XGA. Aquesta pantalla pr\00e0cticament plana d\0027alta resoluci\00f3 ofereix una qualitat d\0027imatge excepcional amb reducci\00f3 de l\0027enlluernament.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (1782,'CA','400/DQ compacta','Impressora d\0027esborranys d\0027alta velocitat de 400 car\00e0cters per segon. Dimensions (alt. x amp. x prof.): 44,04 x 61,62 x 66,85 cm. Interf\00edcie: RS-232 s\00e8rie (9 agulles), sense ranures d\0027expansi\00f3. Mida del paper: A4, carta.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2430,'CA','Compact 400/LQ','Impressora de qualitat carta d\0027alta velocitat a 400 car\00e0cters per segon. Dimensions (alt. x amp. x prof.): 31,42 x 71,02 x 60,76 cm. Interf\00edcie: RS-232 s\00e8rie (25 agulles), 3 ranures d\0027expansi\00f3. Mida del paper: A2, A3, A4.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (1792,'CA','Industrial 600/DQ','Impressora d\0027esborranys de carro ample d\0027alta velocitat, 600 car\00e0cters per segon, amb capacitat de color. Dimensions (alt. x amp. x prof.): 56,67 x 65,1 x 51,10 cm. Mida del paper: de 7,6 x 12.7 cm. a 27,9 x 43,2 cm. de format ample sense marges.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (1791,'CA','Industrial 700/HD','Impressora de matriu de punts de 700 car\00e0cters per segon amb un cos m\00e9s resistent i protecci\00f3 contra la pols per a usos industrials. Interf\00edcie: paral\00b7lela Centronics, d\0027acord amb IEEE 1284. Mida del paper: de 7,6 x 12,7 cm. a 27,9 x 43,2 cm. de format ample sense marges. Mem\00f2ria: 4 MB. Dimensions (alt. x amp. x prof.): 23,62 x 41,91 x 33,02 cm.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2302,'CA','Inkjet B/6','Impressora d\0027injecci\00f3 de tinta en blanc i negre, de 6 p\00e0gines per minut, resoluci\00f3 600 x 300 dpi. Interf\00edcie: paral\00b7lela Centronics, d\0027acord amb IEEE 1284. Dimensions (alt. x amp. x prof.): 18,54 x 44,45 x 35,56 cm. Mida del paper: A3, A4, legal. Sense ranures d\0027expansi\00f3.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2453,'CA','Inkjet C/4','Impressora d\0027injecci\00f3 de tinta, en color (amb dos cartutxos de tinta separats), 6 p\00e0gines per minut en blanc i negre, 4 p\00e0gines per minut en color, resoluci\00f3 600x300 dpi. Interf\00edcie: paral\00b7lela bidireccional, d\0027acord amb IEEE 1284 i interf\00edcie RS-232 s\00e8rie (9 agulles) amb 2 ranures d\0027expansi\00f3 EIO obertes. Mem\00f2ria: buffer receptor de 8 MB 96 KB.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (1797,'CA','Inkjet C/8/HQ','Impressora d\0027injecci\00f3 de tinta, en color, 8 p\00e0gines per minut, gran resoluci\00f3 (qualitat fotogr\00e0fica). Mem\00f2ria: 16 MB. Dimensions (alt. x amp. x prof.): 18,54 x 44,45 x 35,56 cm. Mida del paper: A4, Carta US, sobres. Interf\00edcie: paral\00b7lela Centronics, d\0027acord amb IEEE 1284.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2459,'CA','LaserPro 1200/8/BW','Impressora l\00e0ser professional en blanc i negre, resoluci\00f3 1200 dpi, 8 p\00e0gines per segon. Dimensions (alt. x amp. x prof.): 56,82 x 50,44 x 55,68 cm. Software: suport de controladors millorat per a SPNIX v4.0; controladors d\0027impressora MS-DOS incorporats: tecnologia d\0027escalat ZoomSmart, cartell, fullet, mirall, marca d\0027aigua, vista preliminar, configuraci\00f3 r\00e0pida, emulaci\00f3 de marges d\0027impressora l\00e0ser.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3127,'CA','LaserPro 600/6/BW','Impressora l\00e0ser est\00e0ndard en blanc i negre, resoluci\00f3 de 600 dpi, 6 p\00e0gines per segon. Interf\00edcie: paral\00b7lela Centronics, d\0027acord amb IEEE 1284. Mem\00f2ria: buffer receptor de 8 MB 96 KB. Utilitats MS-DOS ToolBox per a controlador compatible amb SPNIX AutoCAM v.17.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2254,'CA','HD 10GB /I','Unitat de disc dur de gran capacitat de 10 GB (interna). Aquestes unitats han estat concebudes per satisfer les exig\00e8ncies actuals en entorns empresarials amb dades cr\00edtiques i s\00f3n ideals per a aplicacions RAID. Els conjunts d\0027opcions universals es configuren i munten pr\00e8viament a la safata d\0027entrada directa adequada per a la instal\00b7laci\00f3 immediata en el servidor o sistema d\0027emmagatzematge corporatius.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3353,'CA','HD 10GB /R','Unitat de disc dur extra\00efble de 10 GB. Les unitats de disc Supra7 ofereixen la darrera tecnologia per millorar el rendiment de l\0027empresa, ja que permeten d\0027augmentar la velocitat m\00e0xima de transfer\00e8ncia de dades fins a 160 MB/s.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3069,'CA','HD 10GB /S','Unitat de disc dur de 10 GB per a Suport Est\00e0ndard. Compatible amb els sistemes Supra5 anteriors, els usuaris poden distribuir i redistribuir aquestes unitats per augmentar r\00e0pidament la capacitat d\0027emmagatzematge. Les unitats Supra eliminen el risc d\0027incompatibilitat per firmware.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2253,'CA','HD 10GB @5400 /SE','Unitat de disc dur de 10 GB (externa), interf\00edcie SCSI, 5400 rpm. Els conjunts d\0027opcions universals es configuren i munten pr\00e8viament a la safata d\0027entrada directa adequada per a la seva instal\00b7laci\00f3 immediata en el servidor o sistema d\0027emmagatzematge corporatius. Les unitats Supra eliminen el risc d\0027incompatibilitat per firmware.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3354,'CA','HD 12GB /I','Unitat de disc dur de 12 GB de capacitat (interna). Les unitats Supra eliminen el risc d\0027incompatibilitat per firmware. Compatibilitat amb versions anteriors: podeu combinar o unir dispositius Supra2 i Supra3 per obtenir solucions optimitzades i fer possible el creixement futur.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3072,'CA','HD 12GB /N','Unitat de disc dur de 12 GB per a Suport Estret. Les unitats de disc dur Supra9 amb capacitat d\0027instal\00b7laci\00f3 directa ofereixen la possibilitat d\0027instal\00b7lar i eliminar unitats en l\00ednia. Les unitats de disc dur amb capacitat d\0027instal\00b7laci\00f3 r\00e0pida s\00f3n necess\00e0ries per satisfer els nostres rigorosos est\00e0ndards de fiabilitat i rendiment.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3334,'CA','HD 12GB /R','Unitat de disc dur extra\00efble de 12 GB. Compatible amb moltes plataformes d\0027empresa, aquesta unitat pot \00e9sser distribu\00efda i redistribu\00efda per augmentar r\00e0pidament la capacitat d\0027emmagatzematge. Les unitats de disc dur Supra7 Universal pertanyen a la segona generaci\00f3 d\0027unitats d\0027instal\00b7laci\00f3 directa de gran rendiment que tenen compatibilitat per a diferents servidors i dispositius d\0027emmagatzematge extern corporatius.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3071,'CA','HD 12GB /S','Unitat de disc dur de 12 GB per a Suport Est\00e0ndard. Les unitats de disc dur Supra9 amb capacitat d\0027instal\00b7laci\00f3 r\00e0pida ofereixen la possibilitat d\0027instal\00b7lar i extreure les unitats en l\00ednia. Les unitats de disc dur amb capacitat d\0027instal\00b7laci\00f3 directa s\00f3n necess\00e0ries per satisfer els nostres rigorosos est\00e0ndards de fiabilitat i rendiment.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2255,'CA','HD 12GB @7200 /SE','Unitat de disc dur (externa) SCSI de 12 GB de capacitat, 7200 rpm. Aquestes unitats han estat concebudes per a l\0027\00fas en els exigents entorns empresarials actuals amb dades cr\00edtiques i es poden utilitzar en aplicacions RAID. Els kits d\0027opcions universals es configuren i munten pr\00e8viament a la safata d\0027entrada directa adequada per a la seva instal\00b7laci\00f3 immediata en el servidor o sistema d\0027emmagatzematge corporatius.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (1743,'CA','HD 18.2GB @10000 /E','Unitat de disc dur externa - 18,2 GB, velocitat de fins a 10.000 rpm. Aquestes unitats han estat concebudes per a satisfer les exig\00e8ncies dels entorns empresarials actuals amb dades cr\00edtiques i s\00f3n ideals per a l\0027\00fas en aplicacions RAID.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2382,'CA','HD 18.2GB@10000 /I','Unitat de disc dur (interna) SCSI de 18,2 GB a 10.000 rpm. Les unitats de disc Supra7 Universal ofereixen un nivell inigualable de protecci\00f3 de la inversi\00f3 i una simplificaci\00f3 per als clients, ja que les unitats s\00f3n compatibles en un gran nombre de plataformes empresarials.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3399,'CA','HD 18GB /SE','Unitat de disc dur SCSI de 18 GB. Les unitats de disc dur Supra5 Universal ofereixen la possibilitat d\0027una instal\00b7laci\00f3 directa en diversos servidors, matrius RAID i prestatges d\0027emmagatzematge extern.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3073,'CA','HD 6GB /I','Unitat de disc dur (interna) de 6 GB de capacitat. Les unitats Supra eliminen el risc d\0027incompatibilitat per firmware.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (1768,'CA','HD 8.2GB @5400','Unitat de disc dur - 8,2 GB, velocitat de fins a 5.400 rpm. Les unitats Supra eliminen el risc d\0027incompatibilitat per firmware. Interf\00edcie s\00e8rie RS-232 est\00e0ndard.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2410,'CA','HD 8.4GB @5400','Unitat de disc dur de 8,4 GB a 5.400 rpm. Cost de propietat redu\00eft: les unitats es poden utiiltzar en plataformes empresarials. Aquesta unitat de disc dur amb capacitat d\0027instal\00b7laci\00f3 directa \00e9s necess\00e0ria per a satisfer els nostres rigorosos est\00e0ndards de fiabilitat i rendiment.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2257,'CA','HD 8GB /I','Unitat de disc dur (interna) de 8 GB de capacitat. Les unitats de disc dur Supra9 amb capacitat d\0027instal\00b7laci\00f3 directa ofereixen la possibilitat d\0027instal\00b7lar i eliminar unitats en l\00ednia. Compatibilitat amb versions anteriors: podeu combinar o unir dispositius Supra2 i Supra3 per obtenir solucions optimitzades i fer possible un creixement futur.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3400,'CA','HD 8GB /SE','Unitat de disc dur (externa) SCSI de 8 GB. Les unitats de disc Supra7 ofereixen la darrera tecnologia per millorar el rendiment de l\0027empresa, ja que augmenten la velocitat m\00e0xima de transfer\00e8ncia de dades fins a 255 MB/s.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3355,'CA','HD 8GB /SI','Unitat de disc dur SCSI de 8 GB, interna. Compatible amb moltes plataformes d\0027empresa, aquesta unitat es pot distribuir i redistribuir per augmentar r\00e0pidament la capacitat d\0027emmagatzematge.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (1772,'CA','HD 9.1GB @10000','Unitat de disc dur - 9,1 GB, velocitat de fins a 10.000 rpm. Aquestes unitats han estat concebudes per a l\0027\00fas en entorns empresarials amb dades cr\00edtiques. Simplifica la gesti\00f3: permet de seleccionar f\00e0cilment les unitats necess\00e0ries amb independ\00e8ncia de l\0027aplicaci\00f3 en qu\00e8 es distribuiran.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2414,'CA','HD 9.1GB @10000 /I','Unitat de disc dur SCSI de 9,1 GB a 10.000 rpm (interna). Les unitats de disc Supra7 estan disponibles en capacitats i velocitats d\0027eix de 10.000 rpm, de 18 GB i 9,1 GB. Intef\00edcies SCSI i RS-232.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2415,'CA','HD 9.1GB @7200','Unitat de disc dur de 9,1 GB a 7.200 rpm. Els kits d\0027opcions universals es configuren i munten pr\00e8viament a la safata d\0027entrada directa adequada per a la instal\00b7laci\00f3 immediata en el servidor o sistema d\0027emmagatzematge corporatius.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2395,'CA','Cach\00e9 /M de 32 MB','Mem\00f2ria cach\00e9 de 32 MB reflectida (SDRAM registrada a 100 MHz)');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (1755,'CA','Cach\00e9 /NM de 32 MB','Mem\00f2ria cach\00e9 de 32 MB no reflectida');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2406,'CA','Cach\00e9 /M de 64 MB','Mem\00f2ria cach\00e9 de 64 MB reflectida');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2404,'CA','Cach\00e9 /NM de 64 MB','Mem\00f2ria cach\00e9 de 64 MB no reflectida. Els xips de mem\00f2ria FPM s\0027implementen en SIMM de 5 volts, per\00f2 tamb\00e9 estan disponibles en DIMM de 3,3 volts.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (1770,'CA','Cach\00e9 /NM de 8 MB','Mem\00f2ria cach\00e9 de 8 MB no reflectida. (SDRAM registrada a 100 MHz)');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2412,'CA','Mem\00f2ria EDO de 8 MB','Mem\00f2ria SIM EDO 8 x 32 de 8 MB. La mem\00f2ria EDO (sortida de dades ampliada) es diferencia de la FPM en un canvi de disseny petit per\00f2 significatiu. A difer\00e8ncia de l\0027FPM, els controladors de sortida de dades per a EDO segueixen actius quan el controlador de mem\00f2ria elimina l\0027adre\00e7a de columna per comen\00e7ar el seg\00fcent cicle. Per tant, comen\00e7a un cicle de dades nou abans no hagi finalitzat el cicle anterior. L\0027EDO est\00e0 disponible en SIMM i DIMM, en varietats de 3,3 i 5 volts.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2378,'CA','DIMM - 128 MB','Mem\00f2ria DIMM de 128 MB. La ra\00f3 principal del canvi de SIMM a DIMM \00e9s donar suport a l\0027amplada superior del bus de processadors de 64 bits. Els DIMM s\00f3n de 64 o 72 bits; els SIMM tenen una amplada de nom\00e9s 32 o 36 bits (amb paritat).');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3087,'CA','DIMM - 16 MB','DIMM Citrus OLX - 16 MB de capacitat.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2384,'CA','DIMM - 1GB','Mem\00f2ria DIMM: RAM - 1 GB de capacitat.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (1749,'CA','DIMM - 256MB','Mem\00f2ria DIMM: RAM de 256 MB. (SDRAM registrada a 100 MHz)');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (1750,'CA','DIMM - 2GB','Mem\00f2ria DIMM: RAM, 2 GB de capacitat.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2394,'CA','DIMM - 32MB','DIMM d\0027actualitzaci\00f3 de mem\00f2ria de 32 MB');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2400,'CA','DIMM - 512 MB','Mem\00f2ria DIMM de 512 MB. Granularitat d\0027ampliaci\00f3 de mem\00f2ria millorada: Calen menys DIMM que SIMM per actualitzar un sistema. Ampliaci\00f3 dels l\00edmits de mem\00f2ria m\00e0xima: amb el mateix n\00famero de ranures de mem\00f2ria, la quantitat m\00e0xima de mem\00f2ria del sistema \00e9s superior quan s\0027utilitzen DIMM que quan s\0027utilitzen SIMM. Les DIMM tenen contactes separats a cada banda de la placa que dupliquen la relaci\00f3 de dades d\0027una SIMM.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (1763,'CA','DIMM - 64MB','Mem\00f2ria DIMM: RAM, 64 MB (SDRAM CEE no registrada a 100 MHz)');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2396,'CA','EDO - 32MB','SIM de mem\00f2ria EDO: RAM, 32 MB (SDRAM CEE no registrada a 100 MHz). Igual que l\0027FPM, l\0027EDO est\00e0 disponible en SIMM i DIMM, en valors de 3,3 i 5 volts. Si s\0027intal\00b7la mem\00f2ria EDO en un ordinador no dissenyat per suportar-la, \00e9s possible que no funcioni.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2272,'CA','RAM - 16 MB','Mem\00f2ria SIMM: RAM - 16 MB de capacitat.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2274,'CA','RAM - 32 MB','Mem\00f2ria SIMM: RAM - 32 MB de capacitat.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3090,'CA','RAM - 48 MB','Mem\00f2ria d\0027Acc\00e9s Aleatori (RAM), SIMM - 48 MB de capacitat.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (1739,'CA','SDRAM - 128 MB','Mem\00f2ria SDRAM, 128 MB de capacitat. Amb SDRAM es pot accedir a les dades a una velocitat de fins a 100 MHz, una rapidesa quatre vegades superior que amb les DRAM est\00e0ndard. No obstant aix\00f2, els avantatges de l\0027SDRAM nom\00e9s es poden aprofitar plenament en ordinadors dissenyats per suportar aquesta mem\00f2ria. L\0027SDRAM est\00e0 disponible en DIMM de 5 i 3,3 volts.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3359,'CA','SDRAM - 16 MB','M\00f2dul d\0027actualitzaci\00f3 de mem\00f2ria SDRAM, 16 MB. La mem\00f2ria d\0027acc\00e9s aleatoria din\00e0mica s\00edncrona va \00e9sser introdu\00efda despr\00e9s de l\0027EDO. La seva arquitectura i el seu funcionament es basen en la DRAM est\00e0ndard, per\00f2 l\0027SDRAM introdueix un canvi revolucionari a la mem\00f2ria principal per reduir encara m\00e9s els temps de recuperaci\00f3 de dades. L\0027SDRAM est\00e0 sincronitzada amb el rellotge del sistema que controla la CPU. Aix\00f2 significa que el rellotge del sistema que controla les funcions del microprocessador controla tamb\00e9 les funcions de la SDRAM. D\0027aquesta manera, el controlador de la mem\00f2ria pot saber en quin cicle del rellotge estar\00e0 llesta la sol\00b7licitud de dades i s\0027eliminen els retards.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3088,'CA','SDRAM - 32 MB','M\00f2dul SDRAM amb CEE - 32 MB de capacitat. L\0027SDRAM t\00e9 m\00faltiples bancs de mem\00f2ria que poden funcionar simult\00e0niament. La commutaci\00f3 entre els bancs permet un flux de dades continu.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2276,'CA','SDRAM - 48 MB','Mem\00f2ria SIMM: RAM - 48 MB. SDRAM pot funcionar en mode burst. En aquest mode, quan s\0027accedeix a una sola adre\00e7a de dades, es recupera un bloc sencer en comptes d\0027una sola porci\00f3. S\0027assumeix que la seg\00fcent porci\00f3 de dades que se sol\00b7licitar\00e0 ser\00e0 la que segueix en ordre seq\00fcencial a l\0027anterior. Com que normalment \00e9s aix\00ed, les dades es retenen per poder disposar d\0027elles.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3086,'CA','VRAM - 16 MB','M\00f2dul RAM de v\00eddeo Citrus - 16 MB de capacitat. El sistema de v\00eddeo d\0027un ordinador utilitza la VRAM per emmagatzemar la informaci\00f3 de v\00eddeo i es reserva exclusivament per a operacions de v\00eddeo. Es va desenvolupar per proporcionar corrents cont\00ednues de dades s\00e8rie pera al refrescament de les pantalles de v\00eddeo.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3091,'CA','VRAM - 64 MB','M\00f2dul de mem\00f2ria RAM de v\00eddeo Citrus - 64 MB de capacitat. F\00edsicament, la VRAM \00e9s igual que la DRAM amb un hardware afegit anomenat registre de canvi. La caracter\00edstica especial de la VRAM \00e9s que pot transferir una fila sencera de dades (fins a 256 bits) a aquest registre de canvi en un sol cicle de rellotge. Aquesta capacitat redueix significativament el temps de recuperaci\00f3, ja que el nombre de cerques es reduex de les 256 cerques possibles a una de sola. L\0027avantatge principal de tenir el registre de canvi disponible per als buidatges de dades \00e9s que s\0027allibera la CPU per refrescar la pantalla en comptes de recuperar les dades, amb la qual cosa es duplica l\0027ample de banda de dades. Per aquest motiu, habitualment es fa refer\00e8ncia a la VRAM com a mem\00f2ria de doble porta. No obstant aix\00f2, el registre de canvi nom\00e9s s\0027utilitza quan el xip de VRAM envia instruccions especials per fer-ho. La comanda per utilitzar el registre de canvi la genera el controlador de gr\00e0fics.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (1787,'CA','CPU D300','CPU dual a 300 Mhz. Nom\00e9s per al processament personal lleuger o per a servidors de fitxers amb menys de 5 usuaris simultanis. Aquest producte probablement quedar\00e0 obsolet aviat.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2439,'CA','CPU D400','CPU dual a 400 Mhz. Bona relaci\00f3 rendiment/preu; per a servidors de mida mitjana (fins a 100 usuaris simultanis).');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (1788,'CA','CPU D600','CPU dual a 600 Mhz. \00daltima generaci\00f3, alta velocitat de rellotge; per a servidors WAN amb una c\00e0rrega molt gran (fins a 200 usuaris simultanis).');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2375,'CA','GP 1024x768','Processador de gr\00e0fics, resoluci\00f3 de 1024 x 768 p\00edxels. Fant\00e0stica relaci\00f3 rendiment/preu per a aplicacions de 2D i 3D sota SPNIX v3.3 i v4.0. Podeu doblar la possibilitat de visualitzaci\00f3 utilitzant dos monitors des d\0027una sola targeta d\0027aquest tipus. Dos monitors de 17 polzades tenen una zona de visi\00f3 superior que un monitor de 21 polzades. Una opci\00f3 excel\00b7lent per a usuaris que sovint executen m\00faltiples tasques o accedeixen a dades de diversos origens.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2411,'CA','GP 1280x1024','Processador de gr\00e0fics, resoluci\00f3 de 1280 x 1024 p\00edxels. Alt rendiment en 3D a un preu mig: 15 milions de triangles ombrejats Gouraud per segon. Controladors 3D optimitzats per a aplicacions MCAD i DCC, amb valors que l\0027usuari pot personalitzar. Buffer de marc unificat SDRAM DDR de 64 MB amb suport per a color real en totes les resolucions est\00e0ndard admeses.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (1769,'CA','GP 800x600','Processador de gr\00e0fics, resoluci\00f3 de 800 x 600 p\00edxels. Valor excel\00b7lent per a usuaris que necessiten grans capacitats de 2D o suport general de 3D per a aplicacions avan\00e7ades. Proporciona un rendiment incre\00efble en models molt complexes i permet al client de dedicar-se m\00e9s al disseny i no perdre temps en el processament.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2049,'CA','MB - S300','Placa base de tipus PC, s\00e8rie 300.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2751,'CA','MB - S450','Placa base de tipus PC, s\00e8rie 450.');
