INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3114,'CA','MB - S900/650+','Placa base de PC, s\00e8rie 900; placa base est\00e0ndard per a tots els models 650 i superiors.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (3129,'CA','Targeta de So STD','Targeta de So - versi\00f3 est\00e0ndard, amb intef\00edcie MIDI, l\00ednia d\0027entrada/sortida, entrada de micr\00f2fon de baixa imped\00e0ncia.');
