INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2596,'CA','Estoc SS - 1 mm','Estoc d\0027acer inoxidable - 3 mm. Pot ser pr\00e8viament perforat per als suports de placa mare i bateria est\00e0ndard. Utilitzeu la plantilla adequada per identificar el n\00famero de model, la ubicaci\00f3 i la mida del full acabat en enviar la comanda de full perforat.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2631,'CA','Bra\00e7alet/QR ESD','Bra\00e7alet de desc\00e0rrega electroest\00e0tica: conductor de 2 peces amb connector d\0027alliberament r\00e0pid. Una pe\00e7a est\00e0 permanentment connectada al xass\00eds de l\0027ordinador amb un cargol, l\0027altra est\00e0 connectada al bra\00e7alet. Extrems permanents addicionals disponibles.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2721,'CA','Bossa per a PC - L/S','Bossa de cuir negre per a ordinadors - capacitat per a un ordinador port\00e0til amb butxaques per a manuals, hardware addicional i documents de treball. Bandes protectores ajustables i butxaques extra\00efbles per a font d\0027alimentaci\00f3 i cables.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2722,'CA','Bossa per a PC - L/D','Bossa de cuir negre per a ordinadors - capacitat per a dos ordinadors port\00e0tils amb butxaques per a hardware addicional o manuals i documents de treball. Bandes protectores ajustables i butxaques extra\00efbles per a fonts d\0027alimentaci\00f3 i cables. Banda d\0027espatlla doble m\00e9s c\00f2moda.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2725,'CA','Oli per a maquin\00e0ria','Oli per a maquin\00e0ria per lubricar les portes i els clips de la unitat de CD-ROM. Boca regulable per a un flux petit o mitj\00e0 amb neteja autom\00e0tica.');
INSERT INTO PRODUCT_DESCRIPTIONS (PRODUCT_ID,LANGUAGE_ID,TRANSLATED_NAME,TRANSLATED_DESCRIPTION) VALUES (2782,'CA','Bossa per a PC - C/S','Bossa de lona per a ordinadors - capacitat per a un ordinador port\00e0til amb butxaques per a manuals, hardware addicional i documents de treball. Bandes protectores ajustables i butxaca extra\00efble per a font d\0027alimentaci\00f3 i cables. Butxaca exterior amb banda de tancament per accedir-hi f\00e0cilment durant els viatges.');
