VALUES (2412, '8MB EDO Memory', '8 MB 8x32 EDO SIM memory. Extended Data Out memory differs from FPM in a small, but significant design change. Unlike FPM, the data output drivers for EDO remain on when the memory controller removes the column address to begin the next cycle. Therefore, a new data cycle can begin before the previous cycle has completed. EDO is available on SIMMs and DIMMs, in 3.3 and 5 volt varieties.', 14,1, '00', 102058, 'obsolete', 98, 83, 'http://www.supp-102058.com/cat/hw/p2412.html');
VALUES (2378, 'DIMM - 128 MB', '128 MB DIMM memory. The main reason for the change from SIMMs to DIMMs is to support the higher bus widths of 64-bit processors. DIMMs are 64- or 72-bits wide; SIMMs are only 32- or 36-bits wide (with parity).', 14,1, '00', 102050, 'orderable', 305, 247, 'http://www.supp-102050.com/cat/hw/p2378.html');
VALUES (3087, 'DIMM - 16 MB', 'Citrus OLX DIMM - 16 MB capacity.', 14,1, '00', 102081, 'obsolete', 124, 99, 'http://www.supp-102081.com/cat/hw/p3087.html');
VALUES (2384, 'DIMM - 1GB', 'Memory DIMM: RAM - 1 GB capacity.', 14,1, '00', 102074, 'under development', 599, 479, 'http://www.supp-102074.com/cat/hw/p2384.html');
VALUES (1749, 'DIMM - 256MB', 'Memory DIMM: RAM 256 MB. (100-MHz Registered SDRAM)', 14,1, '00', 102053, 'orderable', 337, 300, 'http://www.supp-102053.com/cat/hw/p1749.html');
VALUES (1750, 'DIMM - 2GB', 'Memory DIMM: RAM, 2 GB capacity.', 14,1, '00', 102052, 'orderable', 699, 560, 'http://www.supp-102052.com/cat/hw/p1750.html');
VALUES (2394, 'DIMM - 32MB', '32 MB DIMM Memory upgrade', 14,1, '00', 102054, 'orderable', 128, 106, 'http://www.supp-102054.com/cat/hw/p2394.html');
VALUES (2400, 'DIMM - 512 MB', '512 MB DIMM memory. Improved memory upgrade granularity: Fewer DIMMs are required to upgrade a system than it would require if using SIMMs in the same system. Increased maximum memory ceilings: Given the same number of memory slots, the maximum memory of a system using DIMMs is more than one using SIMMs. DIMMs have separate contacts on each side of the board, which provide two times the data rate as one SIMM.', 14,1, '00', 102098, 'under development', 448, 380, 'http://www.supp-102098.com/cat/hw/p2400.html');
VALUES (1763, 'DIMM - 64MB', 'Memory DIMM: RAM, 64MB (100-MHz Unregistered ECC SDRAM)', 14,1, '00', 102069, 'orderable', 247, 202, 'http://www.supp-102069.com/cat/hw/p1763.html');
VALUES (2396, 'EDO - 32MB', 'Memory EDO SIM: RAM, 32 MB (100-MHz Unregistered ECC SDRAM). Like FPM, EDO is available on SIMMs and DIMMs, in 3.3 and 5 volt varieties If EDO memory is installed in a computer that was not designed to support it, the memory may not work.', 14,1, '00', 102051, 'orderable', 179, 149, 'http://www.supp-102051.com/cat/hw/p2396.html');
VALUES (2272, 'RAM - 16 MB', 'Memory SIMM: RAM - 16 MB capacity.', 14,1, '00', 102074, 'obsolete', 135, 110, 'http://www.supp-102074.com/cat/hw/p2272.html');
VALUES (2274, 'RAM - 32 MB', 'Memory SIMM: RAM - 32 MB capacity.', 14,1, '00', 102064, 'orderable', 161, 135, 'http://www.supp-102064.com/cat/hw/p2274.html');
VALUES (3090, 'RAM - 48 MB', 'Random Access Memory, SIMM - 48 MB capacity.', 14,1, '00', 102084, 'orderable', 193, 170, 'http://www.supp-102084.com/cat/hw/p3090.html');
VALUES (1739, 'SDRAM - 128 MB', 'SDRAM memory, 128 MB capacity. SDRAM can access data at speeds up to 100 MHz, which is up to four times as fast as standard DRAMs. The advantages of SDRAM can be fully realized, however, only by computers designed to support SDRAM. SDRAM is available on 5 and 3.3 volt DIMMs.', 14,1, '00', 102077, 'orderable', 299, 248, 'http://www.supp-102077.com/cat/hw/p1739.html');
VALUES (3359, 'SDRAM - 16 MB', 'SDRAM memory upgrade module, 16 MB. Synchronous Dynamic Random Access Memory was introduced after EDO. Its architecture and operation are based on those of the standard DRAM, but SDRAM provides a revolutionary change to main memory that further reduces data retrieval times. SDRAM is synchronized to the system clock that controls the CPU. This means that the system clock controlling the functions of the microprocessor also controls the SDRAM functions. This enables the memory controller to know on which clock cycle a data request will be ready, and therefore eliminates timing delays.', 14,1, '00', 102059, 'orderable', 111, 99, 'http://www.supp-102059.com/cat/hw/p3359.html');
VALUES (3088, 'SDRAM - 32 MB', 'SDRAM module with ECC - 32 MB capacity. SDRAM has multiple memory banks that can work simultaneously. Switching between banks allows for a continuous data flow.', 14,1, '00', 102057, 'orderable', 258, 220, 'http://www.supp-102057.com/cat/hw/p3088.html');
VALUES (2276, 'SDRAM - 48 MB', 'Memory SIMM: RAM - 48 MB. SDRAM can operate in burst mode. In burst mode, when a single data address is accessed, an entire block of data is retrieved rather than just the one piece. The assumption is that the next piece of data that will be requested will be sequential to the previous. Since this is usually the case, data is held readily available.', 14,1, '00', 102058, 'orderable', 269, 215, 'http://www.supp-102058.com/cat/hw/p2276.html');
VALUES (3086, 'VRAM - 16 MB', 'Citrus Video RAM module - 16 MB capacity. VRAM is used by the video system in a computer to store video information and is reserved exclusively for video operations. It was developed to provide continuous streams of serial data for refreshing video screens.', 14,1, '00', 102056, 'orderable', 211, 186, 'http://www.supp-102056.com/cat/hw/p3086.html');
VALUES (3091, 'VRAM - 64 MB', 'Citrus Video RAM memory module - 64 MB capacity. Physically, VRAM looks just like DRAM with added hardware called a shift register. The special feature of VRAM is that it can transfer one entire row of data (up to 256 bits) into this shift register in a single clock cycle. This ability significantly reduces retrieval time, since the number of fetches is reduced from a possible 256 to a single fetch. The main benefit of having a shift register available for data dumps is that it frees the CPU to refresh the screen rather than retrieve data, thereby doubling the data bandwidth. For this reason, VRAM is often referred to as being dual-ported. However, the shift register will only be used when the VRAM chip is given special instructions to do so. The command to use the shift register is built into the graphics controller.', 14,1, '00', 102098, 'orderable', 279, 243, 'http://www.supp-102098.com/cat/hw/p3091.html');
VALUES (1787, 'CPU D300', 'Dual CPU @ 300Mhz. For light personal processing only, or file servers with less than 5 concurrent users. This product will probably become obsolete soon.', 15,1, '00', 102097, 'orderable', 101, 90, 'http://www.supp-102097.com/cat/hw/p1787.html');
VALUES (2439, 'CPU D400', 'Dual CPU @ 400Mhz. Good price/performance ratio; for mid-size LAN file servers (up to 100 concurrent users).', 15,1, '00', 102092, 'orderable', 123, 105, 'http://www.supp-102092.com/cat/hw/p2439.html');
VALUES (1788, 'CPU D600', 'Dual CPU @ 600Mhz. State of the art, high clock speed; for heavy load WAN servers (up to 200 concurrent users).', 15,1, '00', 102067, 'orderable', 178, 149, 'http://www.supp-102067.com/cat/hw/p1788.html');
